import React from "react"
import {
    Typography,
    Button,
    Container,
    Grid
} from "@material-ui/core"
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(theme => ({
    root: {
      flexGrow: 1,
      height: 50,
      backgroundColor: "white",
    },
    header_title: {

    },
    header_logout: {

    }
  }));

export const Header = () => {
    const classes = useStyles();
    return (
        <div className = {classes.root}>
            <Container maxWidth = "md" style = {{backgroundColor: "", height: "inherit"}}>
                <Grid container>
                    <Grid item xs = {6} className = "header_title">
                        <div style = {{display: "block", float:"left", paddingTop: 10}}>
                            <Typography variant = "h6">
                                Filebox
                            </Typography>
                        </div>

                    </Grid>
                    <Grid item xs = {6} className = "header_logout">
                        <div style = {{display: "block", float:"right", paddingTop: 5}}>
                            <Button>
                                Signout
                            </Button>
                        </div>
                    </Grid>
                </Grid>
            </Container>
        </div>
    )
}
